import Nav from './components/Nav'
import Home from './components/Home'
import {Routes, Route} from 'react-router-dom'

function App() {
  return (
    <div>
      <Nav />
      <Routes>
        <Route path='home' element={<Home />} />
      </Routes>      
    </div>
  );
}

export default App;
